import React, { useState } from 'react';
import { StyleSheet, Text, View, Image, TextInput, Pressable } from 'react-native';
import { SafeAreaView } from 'react-native-safe-area-context';

const LogScreen = ({ navigation }) => {

    return (
        <SafeAreaView style={styles.global}>
            <Text>Coucou</Text>
            
        </SafeAreaView>
    )
}

export default LogScreen;

const styles = StyleSheet.create({
    global: {
        backgroundColor: "rgb(235, 235, 235)",
        flex: 1
    },

    bottomPart: {
        flex: 1,
        justifyContent: "space-between",
        marginTop: 20
        // backgroundColor: "blue"
    },

    image: {
        height: 275,
        width: "100%"
    },

    textInput: {
        // backgroundColor: "red",
        alignSelf: "center",
        width: "75%",
        fontSize: 17,
        color: "black",
        borderBottomWidth: 1,
        borderBottomColor: "grey",
        height: 50,
        textAlign: "center"
    },

    toggleLine: {
        flexDirection: "row",
        justifyContent: "flex-start",
        alignItems: "center",
        width: "75%",
        alignSelf: "center",
        height: 30
    },
    toggle: {
        marginRight: 15
    },

    toggleText: {
        fontSize: 17
    },

    loginButton: {
        backgroundColor: "rgb(173, 26, 26)",
        width: 175,
        height: 40,
        borderRadius: 3,
        overflow: "hidden",
        alignSelf: "center",
        justifyContent: "center",
        alignItems: "center"
    },

    loginButtontext: {
        fontSize: 20,
        color: "white"
    },

    registerButton: {
        alignSelf: "center"
    },

    registerButtonText: {
        fontSize: 20,
        textDecorationLine: "underline",
        textDecorationStyle: "solid",
        textDecorationColor: "black"
    },

    footer: {
        flexDirection: "row",
        justifyContent: "space-between",
        height: 40,
        alignItems: "flex-end"
    },

    footerText: {
        fontSize: 12,
        marginLeft: 10,
        marginRight: 10
    }
})
